'use strict';
class OrderTrailingStopData {
    rate;
    rateRange;
    trailRate;
    stopMove;
    getRate() {
        return this.rate;
    }
    getRateRange() {
        return this.rateRange;
    }
    getTrailRate() {
        return this.trailRate;
    }
    getStopMove() {
        return this.stopMove;
    }
    static create(rate, rateRange, trailRate, stopMove) {
        let data;
        data = new OrderTrailingStopData();
        data.rate = rate;
        data.rateRange = rateRange;
        data.trailRate = trailRate;
        data.stopMove = stopMove;
        return data;
    }
}
module.exports = OrderTrailingStopData
